import measure from "../measure/uiSchema"

export default {
    "ui:title": "Detaljer",
    "ui:layout": "section",
    "ui:options": {
        "collapsible": true,
        "spacing": 2
    },
    "ui:fieldset": [
        "measure",
    ],
    "measure": measure
}
